import Link from "next/link";
import Head from "next/head";
import Layout from '../components/layout'

function HomePage() {
  return (
    <div>
      <Layout></Layout>
      <Head>
        <title>Hero App</title>
      </Head>
      <img
        src="/unicorngundam.webp"
        alt="Unicorn Gundam"
        className="homeimage"
      ></img>
      <h1>Welcome to my Dev Blog</h1>
      <p>
        Learn more about me <Link href="/about">here</Link>
      </p>
    </div>
  );
}

export default HomePage;
